"original": |2-
     In the case of an unsupported attribute name, the Printer returns the
     Client-supplied attribute with a substituted value of 'unsupported'.
     This value's syntax type is "out-of-band", and its encoding is
     defined by special rules for "out-of-band" values in the Encoding and
     Transport document [RFC8010].  Its value indicates no support for the
     attribute itself -- see the beginning of Section 5.1 in this
     document.
"fixed": |-
  In the case of an unsupported attribute name, the Printer returns the Client-supplied attribute with a substituted value of 'unsupported'. This value's syntax type is "out-of-band", and its encoding is defined by special rules for "out-of-band" values in the Encoding and Transport document [RFC8010].  Its value indicates no support for the attribute itself -- see the beginning of Section 5.1 in this document.
"ko": |-
  지원되지 않는 속성 이름의 경우 프린터는 '지원되지 않음'이라는 대체 값을 사용하여 클라이언트 제공 속성을 반환합니다. 이 값의 구문 유형은 "대역 외"이며 해당 인코딩은 인코딩 및 전송 문서 [RFC8010]의 "대역 외" 값에 대한 특수 규칙에 의해 정의됩니다. 해당 값은 속성 자체를 지원하지 않음을 나타냅니다. 이 문서의 섹션 5.1 시작 부분을 참조하세요.
